import React, { Component } from "react";

class nobdList extends Component {
    render(){
        return (
            <div>
                <h2>공지사항</h2>

                <nav>
                    <ul>
                        <li><a href="#">HTML</a></li>
                        <li><a href="#">CSS</a></li>
                        <li><a href="#">JavaScript</a></li>
                    </ul>

                </nav>
            </div>
        )
    }
}
export default nobdList;
